import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
} from "@chakra-ui/react";

function Login(){
    return(
        <FormControl id="email" isRequired>
         <FormLabel>Email</FormLabel>
         <input 
         type="email" 
         value={email}
         placeholder="Enter your email address"
         />
        </FormControl>

    )
}

export default Login;
